import React from "react";
import Products from "../product";
import { Container, Row, Col } from "react-bootstrap";
const Home = () => {
  return (
    <>
      <Row>
        {Products.map((product) => (
          <Col>{product.image}</Col>
        ))}
      </Row>
    </>
  );
};
export default Home;
